Let's have a closer look how it's done in C# nowadays: async Task<int> GetAnswerToTheUltimateQuestionOfLifeTheUniverseAndEverything()
{ HttpClient client = new HttpClient(); // GetStringAsync returns a Task<string>. That means that when you await the // task you'll get a string (urlContents). Task<string> getStringTask = client.GetStringAsync("http://blog.hardcodes.de"); // work here that doesn't rely on the string from GetStringAsync. InitDeepThought(); // - The await operator suspends GetAnswerToTheUltimateQuestionOfLifeTheUniverseAndEverything. // - GetAnswerToTheUltimateQuestionOfLifeTheUniverseAndEverything can't continue until getStringTask is complete. // - Meanwhile, control returns to the caller of GetAnswerToTheUltimateQuestionOfLifeTheUniverseAndEverything. // - Control resumes here when getStringTask is complete. // - The await operator then retrieves the string result from getStringTask. string urlContents = await getStringTask; // ignore string and return the only true answer anyway return 42;
} Isn't that cool? Spin off concurrent execution simply by calling an async function and then continue on the task object when it's ready! The given example was not GUI based but that's exactly the kind of pattern we need.

