- (void)viewWillAppear:(BOOL)animated
{ dispatch_queue_t downloadQueue = dispatch_queue_create(“image downloader”, NULL); dispatch_async(downloadQueue, ^{ NSData *imageData = [NSData dataWithContentsOfURL:networkURL]; dispatch_async(dispatch_get_main_queue(), ^{ UIImage *image = [UIImage imageWithData:imageData]; self.imageView.image = image; self.imageView.frame = CGRectMake(0, 0, image.size.width, image.size.height); self.scrollView.contentSize = image.size; }); }); dispatch_release(downloadQueue);
} Example taken from iPad and iPhone Application Development by Paul Hegarty Before we dive into this example, just a few words to those not familiar with Objective-C: code starting with a caret sign ( as in ^{ //some code here }) is called a Block . This is simply a Lambda function. The dispatch_… code parts call a C API from a library named Grand Central Dispatch . It is used to put Blocks of code in queues that are executed in separate threads. Very similar to the event queueing of the operating system, instead of events some pieces of code are queued. Remember the GCD name, we will come back to that later on. The above mentioned example downloads an image from a network URL in a separate thread and when that is done, it puts the image somewhere in the UI. The UI can only be manipulated from the main thread, so this Block of code is queued on the main thread. By far not as elegant as the C# solution but still a pretty lean way to keep the corresponding pieces of code together. Everything is written in the same function but executed at different times in another context. The burden of multithreading is lifted and abstracted away.

