Make sure that you watch Sean Parent's talk from GoingNative2013. Among a lot of useful insight in coding he mentions libdispatch , published from Apple open source. Out of fairness - and before I begin to write what fascinated me - I must mention that I first was linked to the talk in this tweet from Meeting C++ . The part I am referring to would also match here . Remember the Grand Central Dispatch library in the Objective-C example? The library is open source, too! And Sean parent uses that one to create an even more convenient way to use the power of the library, since he posted the slides in public, I think it's OK to quote his example code here: namespace adobe {
template <typename F, typename ...Args>
auto async(F&& f, Args&&... args)
-> std::future<typename std::result_of<F (Args...)>::type>
{ using result_type = typename std::result_of<F (Args...)>::type; using packaged_type = std::packaged_task<result_type ()>; auto p = new packaged_type(std::forward<F>(f), std::forward<Args>(args)...); auto result = p->get_future(); dispatch_async_f(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), p, [](void* f_) { packaged_type* f = static_cast<packaged_type*>(f_); (*f)(); delete f; });
return result;
}
} // namespace adobe Seems worth looking at, doesn't it? So there are some alternatives to circumvent the blocking future.get() but as nice as they are - they are not standardized. And being in the standard is IMHO needed to get programmers to use such features in their code. Hopefully the Parallelism and / or Concurrency TS get us going this year.

